import './App.css';
import 'react-bootstrap';

const kategorie = ['Dom','Rodzina','Elektronika','Nieruchomości','Obuwie','Odzież'];
const lista_kategorii = kategorie.map((kategorie, i) => <li key={"kategorie_" + i}>{kategorie}</li>);
function App() {
  return (
    <div>
      <hr class="first"></hr>
      <h2> Kategorie </h2>
      <a href="."> <ul class="row">
      {lista_kategorii}
      </ul>
      </a>
    </div>
  );
}

export default App;
